nse notice.', 'comment_created': datetime.datetime(2020, 8, 9, 21, 43, 52, tzinfo=datetime.timezone.utc), 'commenter': 'goneall', 'type': 'User'}, {'comment_id': 467632214, 'comment_body': 'Please add JavaDoc comments for all the new classes and methods', 'comment_created': datetime.datetime(2020, 8, 9, 21, 44, 22, tzinfo=datetime.timezone.utc), 'commenter': 'goneall', 'type': 'User'}, {'comment_id': 467634827, 'comment_body': "Rather than adding these into the templates and writers, it would be much more efficient to update the URLs in the builder while filling in all the details from the License XML file.  Then you could replace each of the calls to either the static classes or the CrossRefHelper with calls to getCrossRefs from the license.

There are a few different hooks we could use in the builder:

1. Build the crossRefs as we are building seeAlso array at https://github.com/spdx/LicenseListPublisher/blob/f8cb27d6da741af0a926a7ba401b3450909c10e0/src/org/spdx/licensexml/LicenseXmlDocument.java#L207
2. Build the crossRefs just before returning the ListedLicense at https://github.com/spdx/LicenseListPublisher/blob/f8cb27d6da741af0a926a7ba401b3450909c10e0/src/org/spdx/licensexml/LicenseXmlDocument.java#L250
3. Create a new `ISpdxListedLicenseProvider` which simply wraps an existing `ISpdxListedLicenseProvider` which simply calls the `getSeeAlso` method and generates and sets the crossRefs.

The first approach is the most straightfoward, but least flexible.

